import React from 'react';

import './css/desktop.css';
import './css/tablet-and-mobile.css';
import './js/progress-bar';

import { ReactComponent as Banner } from './img/scholarship.svg';
import Introduction from './blocks/introduction';
import Concepts from './blocks/concepts';
import Value from './blocks/value/value';
import Direction from './blocks/direction/direction';
import FootnoteLiterature from './blocks/footnote-literature';

const SiteContent = () => {
    return (
        <div className="about-service-full" id="about-service-full">
            <div className="progress" id="progress" style={{width: "0px", backgroundColor: "goldenrod"}}>
                <div
                    className="progress-bar progress-bar-striped"
                    id="progress-bar"
                    role="progressbar"
                    aria-valuenow={25}
                    aria-valuemin={0}
                    aria-valuemax={100}/>
            </div>
            <div className="layout-positioner">
                <div className="banner">
                    <h1>Подробно о сервисе <br/>«University Checklist»</h1>
                    <div className="banner__container">
                        <div className="banner__books"><Banner /></div>
                    </div>
                </div>
                <div className="description">
                    <Introduction />
                    <button id="getScrollingHeight" className="btn mb-4">Получить высоту скроллинга</button>
                    <Concepts />
                    <Value />
                    <Direction />
                    <FootnoteLiterature />
                </div>
            </div>
        </div>
    )
};

export default SiteContent;
